  return (
    <div>
      <h4>{post.buildname} </h4>
      {/*<h3>{user && user.name}</h3>*/}
      {/* <img src='e' alt='background' /> */}
      <h3>Description</h3>
      <p>build details </p>
      <h3>Photos</h3>
      {/* <img src='r' alt='build ' /> */}
